import React from 'react';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import Bootstrap from 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import Admin from './components/index';
import Index from './components/admin';

function App() {
  return (
    <Router>
      <div>
        <nav className='navbar navbar-expand-lg navbar-dark bg-dark'>
          <Link to="/" className='navbar-brand'> SWZ </Link>
          <div className='collapse navbar-collapse '>
            <ul className='navbar-nav'>
              <li className='nav-item'>
                <Link to='#' className='nav-link'> CV </Link>
              </li>
              <li className='nav-item'>
                <Link to='#' className='nav-link'> Portfolio </Link>
              </li>
              <li className='nav-item '>
                <Link to='#' className='nav-link '> Contact </Link>
              </li>
            </ul>
          </div>
          <div className='collapse navbar-collapse justify-content-end'>
            <Link to='#' className='nav-link'> admin </Link>
          </div>
        </nav>
      </div>

      <Route path='/'  component={Index} />
      <Route path='/admin' component={Admin} />
    </Router>
  );
}

export default App;
